import { NgModule } from '@angular/core';
import { Routes, RouterModule } from '@angular/router';

import { RecipeScreen2Page } from './recipe-screen2.page';

const routes: Routes = [
  {
    path: '',
    component: RecipeScreen2Page
  }
];

@NgModule({
  imports: [RouterModule.forChild(routes)],
  exports: [RouterModule],
})
export class RecipeScreen2PageRoutingModule {}
